import {useState} from 'react'
import Calendar from 'react-calendar'
import '../styles/App.css';

function App() {
  const [date,setDate] = useState(new Date());
  return (
    <div className="App">
      <h1 >
       React Calendar 
      </h1>
      <div>
        <Calendar 
          onChange = {setDate} 
          value = {date}
          minDetail='month'

          />
      </div>
      <p>
        <span> selcted date: </span>{' '}
        {date.toDateString()}
      </p>
    </div>
  );
}

export default App;
